import React from 'react';
import {
  Box,
  Typography,
  Button,
  Paper,
  Collapse,
  CircularProgress,
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import RefreshIcon from '@mui/icons-material/Refresh';
import { alpha } from '@mui/material/styles';
import { useBooks } from '../../context/BookContext';
import { motion } from 'framer-motion';

const TaskCard = ({
  icon: Icon,
  title,
  description,
  isExpanded,
  onExpand,
  isGenerating,
  onGenerate,
  showContent,
  generateButtonText,
  children,
  customActions,
  generateButtonStyle
}) => {
  const { isAnyTaskGenerating, setIsAnyTaskGenerating } = useBooks();

  const handleGenerate = async () => {
    setIsAnyTaskGenerating(true);
    await onGenerate();
    setIsAnyTaskGenerating(false);
  };

  return (
    <motion.div 
      className="task-card"
      whileHover={{ scale: 1.02 }}
      transition={{ duration: 0.2 }}
    >
      <Paper sx={{ p: 3 }}>
        <Box sx={{ display: 'flex', alignItems: 'flex-start' }}>
          <Box sx={{ mr: 3, backgroundColor: '#F8F9FF', borderRadius: '12px', p: 2 }}>
            <Icon sx={{ fontSize: 48, color: 'primary.main' }} />
          </Box>
          <Box sx={{ flexGrow: 1 }}>
            <Typography variant="h6" gutterBottom>
              {title}
            </Typography>
            <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
              {description}
            </Typography>
            <Button
              variant="outlined"
              color="primary"
              onClick={onExpand}
              endIcon={isExpanded ? <KeyboardArrowUpIcon /> : <KeyboardArrowDownIcon />}
              disabled={isAnyTaskGenerating}
            >
              ESPANDI
            </Button>

            <Collapse in={isExpanded} timeout="auto" unmountOnExit>
              <Box sx={{ mt: 3 }}>
                <Box sx={{ display: 'flex', justifyContent: 'center', mb: 3 }}>
                  <Button
                    variant="contained"
                    color="primary"
                    startIcon={isGenerating ? <CircularProgress size={20} color="inherit" /> : <Icon />}
                    onClick={handleGenerate}
                    disabled={isGenerating || isAnyTaskGenerating}
                    sx={generateButtonStyle}
                  >
                    {isGenerating ? 'GENERAZIONE IN CORSO...' : generateButtonText}
                  </Button>
                </Box>

                <Collapse in={showContent && !isGenerating} timeout="auto" unmountOnExit>
                  <Box sx={{ mt: 3 }}>
                    {/* Content - Aggiungiamo Paper per lo stile visivo */}
                    <Paper sx={{
                      p: 3,
                      backgroundColor: 'background.paper',
                      '&:hover': {
                        boxShadow: '0px 8px 24px rgba(0, 0, 0, 0.08)',
                      }
                    }}>
                      <Box sx={{ 
                        textAlign: 'justify', 
                        whiteSpace: 'pre-wrap',
                        '& > *': { 
                          mb: 3,
                          lineHeight: 1.8
                        }
                      }}>
                        {children}
                      </Box>
                    </Paper>

                    {/* Actions */}
                    {customActions && (
                      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 3, gap: 2 }}>
                        {customActions}
                      </Box>
                    )}
                  </Box>
                </Collapse>
              </Box>
            </Collapse>
          </Box>
        </Box>
      </Paper>

      <style jsx>{`
        .task-card {
          background: white;
          border-radius: 12px;
          padding: 1.5rem;
          margin: 1rem 0;
          box-shadow: 0 4px 6px rgba(0,0,0,0.05);
        }

        .task-header {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin-bottom: 1rem;
        }

        .status-badge {
          padding: 0.5rem 1rem;
          border-radius: 20px;
          font-size: 0.9rem;
          font-weight: 500;
        }

        .status-badge.completed {
          background: #E8F5E9;
          color: #2E7D32;
        }

        .status-badge.pending {
          background: #FFF3E0;
          color: #E65100;
        }
      `}</style>
    </motion.div>
  );
};

export default TaskCard;
